import assert from 'assert';

export default function ArrayNode(degree, value = undefined) {
	assert(Number.isInteger(degree) && degree >= 2);
	this.a = new Array(degree);
	this.v = value;
}

ArrayNode.prototype.get = function (i) {
	assert(Number.isInteger(i) && i >= 0 && i < this.a.length);
	return this.a[i];
};

ArrayNode.prototype.set = function (i, value = undefined) {
	assert(Number.isInteger(i) && i >= 0 && i < this.a.length);
	this.a[i] = new ArrayNode(this.a.length, value);
	return this.a[i];
};

ArrayNode.prototype.setValue = function (value) {
	this.v = value;
};

ArrayNode.prototype.value = function () {
	return this.v;
};

ArrayNode.prototype[Symbol.iterator] = function* () {
	const degree = this.a.length;
	for (let i = 0; i < degree; ++i) {
		const child = this.a[i];
		if (child !== undefined) yield [i, child];
	}
};

export default function ObjectNode(value = undefined) {
	this.a = {};
	this.v = value;
}

ObjectNode.prototype.get = function (i) {
	return this.a[i];
};

ObjectNode.prototype.set = function (i, value = undefined) {
	this.a[i] = new ObjectNode(value);
	return this.a[i];
};

ObjectNode.prototype.setValue = function (value) {
	this.v = value;
};

ObjectNode.prototype.value = function () {
	return this.v;
};

ObjectNode.prototype[Symbol.iterator] = function* () {
	for (const [i, child] of Object.entries(this.a)) {
		if (child !== undefined) yield [i, child];
	}
};

import {
	makePath,
	writePath,
	readPath,
	has,
	erasePath,
	enumerate,
	getClosestAncestor,
} from './trie';

export default function SimpleTrie(root) {
	this.r = root;
}

SimpleTrie.prototype.set = function (key, value) {
	return writePath(this.r, key, value);
};

SimpleTrie.prototype.get = function (key) {
	return readPath(this.r, key);
};

SimpleTrie.prototype.has = function (key) {
	return has(this.r, key);
};

SimpleTrie.prototype.getClosestAncestor = function (key) {
	return getClosestAncestor(this.r, key);
};

SimpleTrie.prototype.getSubTrie = function (key) {
	const root = makePath(this.r, key);
	return new SimpleTrie(root);
};

SimpleTrie.prototype.delete = function (key) {
	return erasePath(this.r, key);
};

SimpleTrie.prototype[Symbol.iterator] = function () {
	return enumerate(this.r);
};

import ArrayNode from './ArrayNode';
import ObjectNode from './ObjectNode';
import Trie from './Trie';
import trie from './trie';

/* eslint import/no-anonymous-default-export: [2, {"allowObject": true}] */
export default {
	ArrayNode,
	ObjectNode,
	Trie,
	trie,
};

export {ArrayNode, ObjectNode, Trie, trie};

import assert from 'assert';
import {empty, push, pop} from '@aureooms/js-persistent-stack';

export const makePath = (current, key) => {
	assert(current !== undefined);
	const itKey = key[Symbol.iterator]();
	for (const part of itKey) {
		const temporary = current.get(part);
		if (temporary === undefined) {
			return makeNonExistingPath(current.set(part), itKey);
		}

		current = temporary;
	}

	return current;
};

export const makeNonExistingPath = (current, key) => {
	assert(current !== undefined);
	for (const part of key) current = current.set(part);
	return current;
};

export const writePath = (root, key, value) => {
	const current = makePath(root, key);
	current.setValue(value);
	return current;
};

export const readPath = (root, key) => {
	const node = getReference(root, key);
	return node === undefined ? undefined : node.value();
};

export const has = (root, key) => getReference(root, key) !== undefined;

export const getReference = (current, key) => {
	assert(current !== undefined);
	for (const part of key) {
		current = current.get(part);
		if (current === undefined) return undefined;
	}

	return current;
};

export const getClosestAncestor = (ancestor, key) => {
	assert(ancestor !== undefined);
	for (const part of key) {
		const current = ancestor.get(part);
		if (current === undefined) return [part, ancestor];
		ancestor = current;
	}

	return [undefined, ancestor];
};

export const erasePath = (current, key) => {
	assert(current !== undefined);
	for (const part of key) {
		current = current.get(part);
		if (current === undefined) return false;
	}

	if (current.value() === undefined) return false;
	current.setValue(undefined);
	return true;
};

export function* enumerate(root) {
	assert(root !== undefined);
	let prefix = empty();
	if (root.value() !== undefined) yield [prefix, root.value()];
	const stack = [root[Symbol.iterator]()];
	while (true) {
		const it = stack.pop();
		const {value, done} = it.next();
		if (done) {
			if (stack.length === 0) break;
			prefix = pop(prefix);
			continue;
		}

		stack.push(it);
		const [k, node] = value;
		prefix = push(prefix, k);
		if (node.value() !== undefined) yield [prefix, node.value()];
		stack.push(node[Symbol.iterator]());
	}
}

