```js
require( 'regenerator-runtime/runtime' );
// or
import 'regenerator-runtime/runtime.js' ;
```

Then, import the library where needed
```js
const trie = require( '@aureooms/js-trie' ) ;
// or
import * as trie from '@aureooms/js-trie' ;
```
